import{_ as o}from"./plugin-vue_export-helper.21dcd24c.js";import{o as s,c as t,e as r}from"./app.8c639f4e.js";var n="/assets/d49e611175d3e896e6936bf7404a6c9d.af56f8f6.jpg",g="/assets/2b44613de5952e977b191e5d52224fc1.cf6b2c9b.jpg",p="/assets/bed7c5a66f78fbd19e94bf25c51cc771.5768c88d.png",e="/assets/ee6aaf515ec1dd471a9809b808347e0e.99f4a2d1.jpg";const a={},c=r('<audio id="audio" controls="" preload="none"><source id="mp3" src="https://coolcdn.igetcool.com/p/audio/20210115/1f38212bc0e8564235f88ac75fd53d58_48.m4a"></audio><p>\u4F60\u597D\uFF0C\u6B22\u8FCE\u6765\u5230<strong>\u79E6\u66FE\u660C</strong>\u8001\u5E08\u7684\u201C<strong>\u7F16\u7A0B\u601D\u7EF4\u8BFE</strong>\u201D\u3002</p><p>\u4E00\u8BF4\u8D77\u7F16\u7A0B\uFF0C\u4F60\u53EF\u80FD\u6700\u5148\u60F3\u5230\u7684\u662F\u7A0B\u5E8F\u5458\u5750\u5728\u7535\u8111\u524D\u9762<strong>\u6572\u4EE3\u7801</strong>\u7684\u6837\u5B50\u3002\u786E\u5B9E\uFF0C\u8FD9\u5C31\u662F\u4E00\u822C\u4EBA\u5BF9\u201C\u7F16\u7A0B\u201D\u7684\u60F3\u8C61\u3002\u4E0D\u8FC7\uFF0C\u6211\u8981\u544A\u8BC9\u4F60\u7684\u662F\uFF0C\u7F16\u7A0B\u6700\u91CD\u8981\u7684\u5176\u5B9E\u5E76\u4E0D\u662F\u5199\u51FA\u90A3\u4E00\u884C\u884C\u4EE3\u7801\uFF0C\u800C\u662F\u201C<strong>\u7F16\u7A0B\u601D\u7EF4</strong>\u201D\u3002</p><p><img src="'+n+'" alt="\u4EE3\u7801"></p><p>\u90A3\u4EC0\u4E48\u662F\u7F16\u7A0B\u601D\u7EF4\u5462\uFF1F\u7F16\u7A0B\u601D\u7EF4\u5C31\u662F\u4E00\u79CD\u628A\u4E00\u4E2A\u95EE\u9898<strong>\u8F6C\u5316</strong>\u6210\u53E6\u4E00\u4E2A\u95EE\u9898\uFF0C\u5E76\u4E14\u628A\u5B83\u89E3\u51B3\u6389\u7684\u601D\u8003\u65B9\u5F0F\u3002\u8FD9\u4E48\u8BF4\u6709\u4E9B\u62BD\u8C61\uFF0C\u6211\u7ED9\u4F60\u4E3E\u4E2A\u4F8B\u5B50\u5427\u3002</p><p>\u4F60\u5728\u6570\u5B66\u8BFE\u4E0A\uFF0C\u5DF2\u7ECF\u5B66\u8FC7<strong>\u9762\u79EF\u516C\u5F0F</strong>\u4E86\u5427\uFF1F\u4F60\u53EF\u4EE5\u901A\u8FC7\u516C\u5F0F\uFF0C\u6765\u8BA1\u7B97\u957F\u65B9\u5F62\u3001\u4E09\u89D2\u5F62\u548C\u5706\u5F62\u7684\u9762\u79EF\u3002\u90A3\u5982\u679C\u73B0\u5728\u6211\u5728\u7EB8\u4E0A\u753B\u4E86\u4E00\u53EA\u5927\u718A\u732B\uFF0C\u7136\u540E\u8BF7\u4F60\u8BA1\u7B97\u4E00\u4E0B\uFF0C\u8FD9\u53EA<strong>\u5927\u718A\u732B\u6240\u5360\u7684\u9762\u79EF</strong>\uFF0C\u90A3\u53C8\u8BE5\u600E\u4E48\u529E\u5462\uFF1F</p><p><img src="'+g+'" alt="img"></p><p>\u4F60\u53EF\u80FD\u4F1A\u95EE\u4E86\uFF0C\u79E6\u8001\u5E08\uFF0C\u90A3\u6709\u6CA1\u6709\u6C42\u5927\u718A\u732B\u9762\u79EF\u7684\u516C\u5F0F\u554A\uFF1F\u54C8\u54C8\uFF0C\u8FD9\u6837\u7684\u516C\u5F0F\u53EF\u4E0D\u5B58\u5728\u54E6\u3002\u4F60\u8981\u60F3\u77E5\u9053\u5927\u718A\u732B\u6240\u5360\u7684\u9762\u79EF\uFF0C\u5C31\u9700\u8981\u5229\u7528\u7F16\u7A0B\u601D\u7EF4\uFF0C\u628A\u8FD9\u4E2A\u95EE\u9898\uFF0C<strong>\u8F6C\u5316</strong>\u6210\u53E6\u4E00\u4E2A\u95EE\u9898\u2014\u2014\u4F60\u53EF\u4EE5\u60F3\u8C61\u4E00\u4E0B\uFF0C\u5982\u679C\u5728\u4E00\u5F20\u7EB8\u4E0A\u5148\u753B\u51FA\u8FD9\u53EA\u5927\u718A\u732B\uFF0C\u7136\u540E\u518D\u5728\u7EB8\u4E0A<strong>\u5747\u5300\u5730\u6492\u4E00\u5C42\u5927\u7C73\u7C92</strong>\u3002\u90A3\u4E48\uFF0C\u5927\u718A\u732B\u56FE\u5F62\u8303\u56F4\u91CC\u7684\u7C73\u7C92\u6570\uFF0C\u8DDF\u5B83\u6240\u5360\u7684\u9762\u79EF\u662F\u6709\u5173\u7684\u3002</p><p>\u6BD4\u5982\u8BF4\u5427\uFF0C\u5982\u679C\u8FD9\u53EA\u5927\u718A\u732B\u7684\u9762\u79EF\uFF0C\u662F\u8FD9\u5F20\u7EB8\u5168\u90E8\u9762\u79EF\u7684\u4E00\u534A\uFF0C\u90A3\u4E48\u5927\u718A\u732B\u4E0A\u9762<strong>\u8986\u76D6</strong>\u7684\u90A3\u4E00\u5C42\u7C73\u7C92\uFF0C\u6570\u91CF\u4E5F\u5E94\u8BE5\u662F\u6240\u6709\u7C73\u7C92\u7684\u4E00\u534A\u3002</p><p>\u8FD9\u65F6\u5019\uFF0C\u6211\u4EEC\u5C31\u628A\u6C42\u5927\u718A\u732B\u9762\u79EF\u7684\u8FD9\u4E2A\u95EE\u9898\uFF0C<strong>\u8F6C\u5316</strong>\u6210\u4E86\u5F04\u6E05\u695A\u5927\u718A\u732B\u7684\u56FE\u6848\u4E0A\u9762\uFF0C\u8986\u76D6\u4E86\u591A\u5C11\u7C73\u7C92\u3002\u518D\u6570\u4E00\u4E0B\u8FD9\u4E9B\u7C73\u7C92\uFF0C\u8DDF\u7EB8\u4E0A\u5176\u4ED6\u5730\u65B9\u7684\u7C73\u7C92\u6570<strong>\u6BD4\u4E00\u4E0B</strong>\uFF0C\u518D\u7B97\u4E00\u4E0B\u8FD9\u5F20\u7EB8\u7684\u9762\u79EF\uFF0C\u8FD9\u6837\uFF0C\u5373\u4F7F\u6CA1\u6709\u6C42\u5927\u718A\u732B\u9762\u79EF\u7684\u516C\u5F0F\uFF0C\u6211\u4EEC\u4E5F\u80FD\u8BA1\u7B97\u51FA\u5927\u718A\u732B\u7684\u9762\u79EF\u4E86\u3002</p><p>\u4F60\u770B\uFF0C\u8FD9\u5C31\u662F\u7F16\u7A0B\u601D\u7EF4\u5F53\u4E2D\u7684\u4E00\u4E2A\u6838\u5FC3\u601D\u60F3\u2014\u2014<strong>\u95EE\u9898\u8F6C\u5316\u601D\u60F3</strong>\u3002\u800C\u6211\u7ED9\u4F60\u4E3E\u7684\u8FD9\u4E2A\u4F8B\u5B50\uFF0C\u4E5F\u662F\u4E00\u79CD\u7279\u522B\u5E38\u89C1\u7684\u7F16\u7A0B\u7B97\u6CD5\uFF0C\u53EB\u505A<strong>\u8499\u7279\u5361\u6D1B\u7B97\u6CD5</strong>\u3002\u4F60\u53EF\u80FD\u542C\u8BF4\u8FC7\uFF0C\u6709\u4E00\u4E2A\u5F88\u5389\u5BB3\u7684\u4EBA\u5DE5\u667A\u80FD\u7A0B\u5E8F\u53EB <strong>AlphaGo</strong>\uFF0C\u4E0B\u56F4\u68CB\u80DC\u8FC7\u4E86\u4EBA\u7C7B\u5F53\u4E2D\u6700\u5389\u5BB3\u7684\u68CB\u624B\u3002AlphaGo \u7684\u601D\u8003\u65B9\u6CD5\uFF0C\u5C31\u8DDF\u8499\u7279\u5361\u6D1B\u7B97\u6CD5\u6709\u5173\u3002</p><p><img src="'+p+'" alt="AlphaGo\u7684\u6807\u5FD7"></p><p>\u4F60\u53EF\u522B\u89C9\u5F97\u7F16\u7A0B\u601D\u7EF4\u53EA\u80FD\u7528\u6765\u4E0B\u56F4\u68CB\u3002\u5176\u5B9E\u5728\u751F\u6D3B\u4E2D\uFF0C\u50CF\u8FD9\u79CD\u7F16\u7A0B\u601D\u7EF4\u7684\u5E94\u7528\u8FD8\u6709\u5F88\u591A\u5F88\u591A\uFF0C\u6211\u4F1A\u901A\u8FC7<strong>30\u4E2A\u6545\u4E8B</strong>\uFF0C\u8BA9\u4F60\u5B66\u4F1A<strong>12\u79CD\u601D\u7EF4\u65B9\u5F0F</strong>\u548C<strong>10\u79CD\u89E3\u51B3\u95EE\u9898\u7684\u529E\u6CD5</strong>\u3002</p><p>\u53E6\u5916\uFF0C\u4F60\u53EF\u80FD\u542C\u8BF4\u8FC7\uFF0C\u54B1\u4EEC\u56FD\u5BB6\u5DF2\u7ECF\u5F00\u59CB\u5728<strong>\u5B66\u6821\u6559\u6750</strong>\u91CC\u52A0\u5165\u4EBA\u5DE5\u667A\u80FD\u7684\u5185\u5BB9\u4E86\u3002\u73B0\u5728\uFF0C\u9AD8\u4E2D\u4FE1\u606F\u6280\u672F\u8BFE\u7684\u8BFE\u672C\u91CC\u5DF2\u7ECF\u52A0\u5165\u4E86\u3002\u4E2D\u5C0F\u5B66\u5462\uFF0C\u867D\u7136\u8FD8\u6CA1\u6709\u7EDF\u4E00\u7684\u6559\u6750\uFF0C\u4F46\u5F88\u591A\u5B66\u6821\u4E5F\u90FD\u5F00\u59CB\u5F00\u8BBE<strong>\u4EBA\u5DE5\u667A\u80FD\u8BFE\u7A0B</strong>\u4E86\uFF0C\u8BF4\u4E0D\u5B9A\u4F60\u6240\u5728\u7684\u5B66\u6821\u5DF2\u7ECF\u5F00\u59CB\u4E0A\u8FD9\u6837\u7684\u8BFE\u4E86\u3002</p><p>\u5F53\u7136\u4E86\uFF0C\u5F00\u8BBE\u4EBA\u5DE5\u667A\u80FD\u8BFE\u5E76\u4E0D\u662F\u4E3A\u4E86\u628A\u5927\u5BB6\u90FD\u57F9\u517B\u6210\u4EBA\u5DE5\u667A\u80FD\u4E13\u5BB6\u3002\u5728\u54B1\u4EEC\u8FD9\u4E2A\u65F6\u4EE3\uFF0C\u4EBA\u5DE5\u667A\u80FD\u5DF2\u7ECF\u8FDB\u5165\u4E86\u6211\u4EEC\u751F\u6D3B\u7684\u65B9\u65B9\u9762\u9762\uFF0C\u4E86\u89E3\u4EBA\u5DE5\u667A\u80FD\u6280\u672F\u548C\u80CC\u540E\u7B80\u5355\u7684\u9053\u7406\u53EF\u4EE5<strong>\u62D3\u5BBD</strong>\u6211\u4EEC\u7684\u79D1\u6280\u89C6\u91CE\uFF0C\u4E3A\u6211\u4EEC\u672A\u6765\u7684\u751F\u6D3B\u505A\u597D\u51C6\u5907\u3002</p><p>\u6BD4\u65B9\u8BF4\uFF0C\u54B1\u4EEC\u597D\u591A\u624B\u673A\u8F6F\u4EF6\u90FD\u6709<strong>\u56FE\u7247\u8BC6\u522B\u529F\u80FD</strong>\uFF0C\u53EA\u8981\u4E0A\u4F20\u4E00\u5F20\u690D\u7269\u7684\u7167\u7247\uFF0C\u624B\u673A\u8F6F\u4EF6\u5C31\u80FD\u544A\u8BC9\u4F60\u8FD9\u662F\u4EC0\u4E48\u6811\u3001\u4EC0\u4E48\u82B1\uFF0C\u5B83\u662F\u600E\u4E48\u77E5\u9053\u7684\u5462\uFF1F</p><p>\u8FD8\u6709\u554A\uFF0C\u5F88\u591A\u8F6F\u4EF6\u91CC\u4F1A\u81EA\u5E26\u7F8E\u989C\u529F\u80FD\uFF0C\u53EF\u4EE5\u628A\u4F60\u7684\u773C\u775B\u53D8\u5927\uFF0C\u5728\u8111\u888B\u4E0A\u52A0\u4E24\u4E2A\u732B\u8033\u6735\uFF0C\u6216\u8005\u628A\u817F\u62C9\u957F\u3002\u90A3\u624B\u673A\u8F6F\u4EF6\u600E\u4E48\u77E5\u9053\u54EA\u91CC\u662F\u773C\u775B\u54EA\u91CC\u662F\u8111\u888B\u7684\u5462\uFF1F</p><p><img src="'+e+'" alt="\u4EBA\u8138\u8BC6\u522B"></p><p>\u5176\u5B9E\u8FD9\u4E9B\uFF0C\u90FD\u5C5E\u4E8E\u4EBA\u5DE5\u667A\u80FD\u7814\u7A76\u7684\u4E00\u4E2A\u9886\u57DF\uFF0C\u53EB\u505A<strong>\u673A\u5668\u5B66\u4E60</strong>\u3002\u79D1\u5B66\u5BB6\u4EEC\u4F1A\u6559\u8BA1\u7B97\u673A\u8BA4\u8BC6\u5404\u79CD\u5404\u6837\u7684\u4E1C\u897F\uFF0C\u53EF\u662F\u8BA1\u7B97\u673A\u6CA1\u6709\u54B1\u4EEC\u8FD9\u6837\u7684\u5927\u8111\uFF0C\u5B83\u7684\u5B66\u4E60\u8DDF\u54B1\u4EEC\u7684\u5B66\u4E60\u6709\u4EC0\u4E48\u4E0D\u540C\u5462\uFF1F\u6211\u4F1A\u5728\u540E\u9762\u7684\u8BFE\u7A0B\u91CC\u8BE6\u7EC6\u7ED9\u4F60\u8BF4\u3002</p><p>\u542C\u5B8C\u6211\u7684\u8BFE\uFF0C\u4F60\u4E0D\u5149\u80FD\u8FD0\u7528\u8EAB\u8FB9\u7684<strong>\u9AD8\u79D1\u6280\u5DE5\u5177</strong>\uFF0C\u8FD8\u80FD\u77E5\u9053\u5B83\u4EEC\u80CC\u540E\u7684<strong>\u539F\u7406</strong>\uFF0C\u6210\u4E3A\u751F\u6D3B\u4E2D\u7684<strong>\u79D1\u6280\u5C0F\u8FBE\u4EBA</strong>\u3002</p><p>\u8FD9\u5C31\u662F\u4E3A\u4EC0\u4E48\u6211\u5728\u8FD9\u91CC\uFF0C\u4E0D\u76F4\u63A5\u6559\u4F60\u600E\u4E48\u5199\u4EE3\u7801\uFF0C\u800C\u6559\u4F60\u4EC0\u4E48\u662F\u7F16\u7A0B\u601D\u7EF4\u3002\u5199\u4EE3\u7801\u4EE5\u540E\u53EF\u4EE5\u6162\u6162\u5B66\uFF0C\u4F46\u5373\u4F7F\u4E0D\u5199\u4EE3\u7801\uFF0C\u7F16\u7A0B\u601D\u7EF4\u4E5F\u4E00\u6837\u53EF\u4EE5\u8BA9\u4F60<strong>\u53D7\u76CA\u7EC8\u8EAB</strong>\u3002</p><p>\u90A3\u4E3A\u4EC0\u4E48\u662F\u6211\u6765\u7ED9\u4F60\u8BB2\u8BFE\u5462\uFF1F</p><p>\u6211\u662F\u4E00\u4E2A\u4EBA\u5DE5\u667A\u80FD\u7684<strong>\u4E13\u5BB6</strong>\uFF0C\u73B0\u5728\u5728\u5317\u4EAC\u822A\u7A7A\u822A\u5929\u5927\u5B66\u505A<strong>\u6559\u6388</strong>\u3002\u6211\u5728\u82F1\u56FD\u725B\u6D25\u5927\u5B66\u3001\u7F8E\u56FD\u5361\u5185\u57FA\u6885\u9686\u5927\u5B66\u4E5F\u505A\u8FC7<strong>\u8BBF\u95EE\u5B66\u8005</strong>\uFF0C\u6240\u4EE5\uFF0C\u6211\u5BF9\u7F16\u7A0B\u548C\u4EBA\u5DE5\u667A\u80FD\u65B9\u9762\u7684\u77E5\u8BC6\u90FD\u975E\u5E38\u4E86\u89E3\u3002</p><p>\u540C\u65F6\uFF0C\u6211\u4E5F\u7279\u522B\u4E86\u89E3\u5B69\u5B50\u3002\u6211\u662F\u513F\u7AE5\u7F16\u7A0B\u5E73\u53F0\u201C\u7F16\u7A0B\u732B\u201D\u7684<strong>\u9996\u5E2D\u79D1\u5B66\u5BB6</strong>\uFF0C\u5BF9\u4E8E\u5982\u4F55\u7ED9\u5B69\u5B50\u8BB2\u7F16\u7A0B\u65B9\u9762\u7684\u77E5\u8BC6\u975E\u5E38\u6709\u7ECF\u9A8C\u3002\u6211\u80FD\u591F\u7528\u5B69\u5B50\u542C\u5F97\u61C2\u7684\u8BDD\uFF0C\u628A\u7F16\u7A0B\u91CC\u6700\u91CD\u8981\u7684\u601D\u60F3\u5185\u5BB9\u603B\u7ED3\u51FA\u6765\u3002</p><p>\u800C\u4E14\uFF0C\u6211\u8FD8\u53C2\u52A0\u4E86\u5F88\u591A\u79D1\u666E\u6D3B\u52A8\uFF0C\u628A\u79D1\u5B66\u4E2D\u597D\u73A9\u7684\u6545\u4E8B\u8BB2\u7ED9\u4EBA\u4EEC\u542C\uFF0C\u6BD4\u5982\uFF0C\u6211\u662F\u56FD\u5185\u6700\u5927\u7684\u79D1\u666E\u7F51\u7AD9<strong>\u679C\u58F3\u7F51\u7684\u79D1\u5B66\u987E\u95EE</strong>\uFF0C\u7FFB\u8BD1\u8FC7\u597D\u51E0\u672C\u79D1\u666E\u4E66\uFF0C<strong>\u505A\u8FC7\u5F88\u591A\u7ED9\u5B69\u5B50\u7684\u79D1\u666E\u8BB2\u5EA7</strong>\uFF0C\u6240\u4EE5\u6211\u7ED9\u4F60\u8BB2\u8FD9\u95E8\u8BFE\uFF0C\u4E0D\u5149\u4F1A\u6709\u5F88\u591A\u5E72\u8D27\u77E5\u8BC6\uFF0C\u8FD8\u6709\u5F88\u591A\u6709\u8DA3\u7684\u6545\u4E8B\uFF0C\u8BA9\u4F60\u8FB9\u542C\u6545\u4E8B\u8FB9\u5B66\u77E5\u8BC6\u3002</p><p>\u6BD4\u5982\u4E0B\u4E00\u96C6\uFF0C\u6211\u5C31\u8981\u7ED9\u4F60\u8BF4\u4E00\u4E2A\u6709\u5173\u4EBA\u578B\u673A\u5668\u4EBA\u7684\u6545\u4E8B\u3002\u5047\u5982\uFF0C\u6211\u4EEC\u7684\u8EAB\u8FB9\u6DF7\u5165\u4E86\u4E00\u53F0\u90AA\u6076\u7684\u4EBA\u578B\u673A\u5668\u4EBA\uFF0C\u5B83\u957F\u5F97\u8DDF\u771F\u4EBA\u4E00\u6A21\u4E00\u6837\uFF0C\u4E0D\u8FC7\uFF0C\u5374\u6697\u4E2D\u60F3\u8981\u7EDF\u6CBB\u5168\u4EBA\u7C7B\uFF0C\u8BA9\u6211\u4EEC\u7ED9\u5B83\u5F53\u5974\u96B6\u3002\u90A3\u4E48\uFF0C\u73B0\u5728\u6211\u4EEC\u8BE5\u600E\u4E48\u628A\u5B83\u63EA\u51FA\u6765\uFF0C\u62EF\u6551\u4E16\u754C\u5462\uFF1F\u5FEB\u5230\u6211\u4EEC\u7684\u8BD5\u542C\u7279\u8F91\u91CC\u53BB\u627E\u7B54\u6848\u5427\u3002</p>',26),d=[c];function i(_,f){return s(),t("div",null,d)}var b=o(a,[["render",i],["__file","index.html.vue"]]);export{b as default};
